import React from 'react';
import './App.css';
import iframe from 'react-iframe'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="Emulator">
          <iframe title="emulator" src="emulator.html" allowFullScreen="true"></iframe>
        </div>
      </header>
    </div>
  );
}

export default App;
